import Head from "next/head";
// import App from "next/app";


const MyApp = ({ Component, pageProps }) => {
    return (
        <>
            <Head>
                <title>Next Passport Auth</title>
                {/* <link rel="icon" href="/favicon.ico" /> */}
            </Head>
            <Component {...pageProps} />
        </>
    )
}

export default MyApp;
